import axios from 'axios';

const API_URL  = 'https://api.themoviedb.org/3/movie/550?api_key=68ae61f2720168696df123e0c841e5d8';

export default function ApiService() {
      return axios.get(
          API_URL,
          {
              headers: {
                  "Content-Type": "application/json"
              }
          }
      )
}
